import React, { Component } from 'react'
import { Col } from 'react-bootstrap'

export default class Hasil extends Component {
  render() {
    return (
      <Col md={3} mt="3">
        <h4>
          <strong>Hasil</strong>
        </h4>
        <hr />
      </Col>


    )
  }
}
